import React from 'react'
// import './App.css'
import Particles from 'react-tsparticles'
import particlesConfig from './containers/particles/particles-config'

import {Footer, Home, Projects, Services, Navbar} from './containers'



const App = () => {
  return (
    // <Particles params={particlesConfig}></Particles>
    <div className='App'>

      <div className='gradient__bg'>
        <Navbar/>
        <Home/>
      </div>
      <Projects/>
      <Services/>
      <Footer/>
    </div>
  )
}

export default App
